import React from 'react';

const WhaleIcon = ({ size = 24, className = '' }) => {
  return (
    <svg 
      width={size} 
      height={size} 
      viewBox="0 0 24 24" 
      fill="none" 
      xmlns="http://www.w3.org/2000/svg"
      className={className}
    >
      {/* 鲸鱼身体主体 - C形，蓝色紫色调 */}
      <path 
        d="M18 6C18 8 16 10 14 12C12 14 10 16 8 18C6 20 4 20 2 18C0 16 0 14 2 12C4 10 6 8 8 6C10 4 12 2 14 2C16 2 18 4 18 6Z" 
        fill="#6366f1"
      />



      {/* 鲸鱼身体内部 - 白色肚子 */}
      <path 
        d="M16 6C16 7.5 14.5 9 13 10.5C11.5 12 10 13.5 8.5 15C7 16.5 5.5 17 4.5 16C3.5 15 3.5 13.5 4.5 12C5.5 10.5 7 9 8.5 7.5C10 6 11.5 4.5 13 4.5C14.5 4.5 16 5 16 6Z" 
        fill="white"
      />

      {/* 鲸鱼眼睛 */}
      <circle cx="12" cy="8" r="1" fill="#1e293b" />

      {/* 鲸鱼嘴巴 */}
      <ellipse cx="14" cy="10" rx="1.5" ry="1" fill="#6366f1" />

      {/* 鲸鱼尾巴 - 向上指向右上 */}
      <path 
        d="M4 4L2 2L4 0L6 2L4 4Z" 
        fill="#6366f1"
      />

      {/* 鲸鱼尾巴装饰 */}
      <path 
        d="M3 1L5 3L3 5L1 3L3 1Z" 
        fill="#4f46e5"
      />

      {/* 鲸鱼身体轮廓装饰 */}
      <path 
        d="M16 6C16 7.5 14.5 9 13 10.5C11.5 12 10 13.5 8.5 15C7 16.5 5.5 17 4.5 16" 
        stroke="#4f46e5" 
        strokeWidth="0.5" 
        fill="none"
      />
    </svg>
  );
};

export default WhaleIcon;
